import React from "react";
import HomaPage from "./pages/homepage/honepage-com";
import "./App.css";
import { Switch, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/" component={HomaPage} />
      </Switch>
    </div>
  );
}

export default App;
